/**
 * @internal
 * commit the values
 */
int
_mfd_clabWIFIAccessPointTable_commit(netsnmp_mib_handler *handler,
                         netsnmp_handler_registration *reginfo,
                         netsnmp_agent_request_info *agtreq_info,
                         netsnmp_request_info *requests)
{
    int                    rc;
    clabWIFIAccessPointTable_rowreq_ctx *rowreq_ctx = (clabWIFIAccessPointTable_rowreq_ctx*)
                  netsnmp_container_table_row_extract(requests);

    DEBUGMSGTL(("internal:clabWIFIAccessPointTable:_mfd_clabWIFIAccessPointTable_commit","called\n"));

    netsnmp_assert(NULL != rowreq_ctx);
    
    rc = clabWIFIAccessPointTable_commit(rowreq_ctx);
    if (MFD_SUCCESS != rc) {
        DEBUGMSGTL(("clabWIFIAccessPointTable:mfd","error %d from "
                    "clabWIFIAccessPointTable_commit\n", rc));
        netsnmp_request_set_error_all(requests, SNMP_VALIDATE_ERR(rc));
    }

    if (rowreq_ctx->rowreq_flags & MFD_ROW_DIRTY) {
        /*
         * if we successfully commited this row, set the dirty flag. Use the
         * current value + 1 (i.e. dirty = # rows changed).
         * this is checked in post_request...
         */
        clabWIFIAccessPointTable_dirty_set( clabWIFIAccessPointTable_dirty_get() + 1 ); /* set table dirty flag */
    }

    return SNMP_ERR_NOERROR;
}

int
_mfd_clabWIFIAccessPointTable_undo_commit(netsnmp_mib_handler *handler,
                         netsnmp_handler_registration *reginfo,
                         netsnmp_agent_request_info *agtreq_info,
                         netsnmp_request_info *requests)
{
    int                    rc;
    clabWIFIAccessPointTable_rowreq_ctx *rowreq_ctx = (clabWIFIAccessPointTable_rowreq_ctx*)
                  netsnmp_container_table_row_extract(requests);

    DEBUGMSGTL(("internal:clabWIFIAccessPointTable:_mfd_clabWIFIAccessPointTable_undo_commit","called\n"));

    netsnmp_assert(NULL != rowreq_ctx);

    if (rowreq_ctx->rowreq_flags & MFD_ROW_DIRTY) {
        u_int  d = clabWIFIAccessPointTable_dirty_get();

        netsnmp_assert(d != 0);
        if(d)
            clabWIFIAccessPointTable_dirty_set( d - 1 );
    }

    rc = clabWIFIAccessPointTable_undo_commit(rowreq_ctx);
    if (MFD_SUCCESS != rc) {
        /*
         * nothing we can do about it but log it
         */
        DEBUGMSGTL(("clabWIFIAccessPointTable:mfd","error %d from "
                    "clabWIFIAccessPointTable_undo_commit\n", rc));
    }

    if (rowreq_ctx->rowreq_flags & MFD_ROW_DIRTY) {
        snmp_log(LOG_WARNING, "clabWIFIAccessPointTable row dirty flag still set after undo_commit\n");
        rowreq_ctx->rowreq_flags &= ~MFD_ROW_DIRTY;
    }

    return SNMP_ERR_NOERROR;
} /* _mfd_clabWIFIAccessPointTable_commit */

